import styled from 'styled-components';


export const Outbox = styled.div`
    /* display: flex;
    vertical-align: center;
    align-items: center; */
    text-align: center;
    width: 100vw;
    height: 100vh;
    margin: 0 auto;
    border: 1px solid red;

    @media screen and (min-width: 750px) {
        width: 750px;
    }

`
